import React from 'react';
import { IonPage, IonLabel } from '@ionic/react';





class Login{
  show: React.FC = () => {  
    return (
      <IonPage>
        <IonLabel>testing this</IonLabel>
      </IonPage>
    );
  };
}
var login = new Login()
export default login.show;
